function setExportPdf(config){

    function pxToMm(px){
        return Math.floor(px/$('#pxMmTest').height());
    }
    var todayDDMMYYYY = moment().format("DD-MM-YYYY");
    var todayYYYYMMDD = moment().format("YYYYMMDD");

    $('#export-pdf').on('click', function() {

        function topFunction() {
            document.body.scrollTop = 0; // For Chrome, Safari and Opera
            document.documentElement.scrollTop = 0; // For IE and Firefox
        }

        topFunction();
        var initHeight = $('#map').css('height');
        var initWidth = $('#map').css('width');
        $('#modalTable').modal('show');

        setTimeout(function(){
            $('#map').css('height', '210mm');
            $('#map').css('width', '240mm');							
        },200);

/*
DISCLAIMER pour carte .pdf*
This map has been exported from MSF Map Centre on personal initiative. MSF GIS Unit is not responsible for the content and display.

*/	

        map.once('postrender', function() {


            setTimeout(function(){
            // Init document
                var doc = new jsPDF('l', 'mm', [210, 297]);

            // General Layout
                // Map
                var canvas_map = $("canvas.ol-unselectable")[0];
                var dataUrl_map = canvas_map.toDataURL();
                 doc.addImage(dataUrl_map,'PNG',0,0,240,205);

                // Header + title
                var header_msf = "data:image/png;base64,";
                doc.addImage(header_msf,'PNG',0,-1,300,18);

                var filterVal = $("#selectWeek_value").children().text();          
                doc.setTextColor(255,255,255).setFontSize(13).setFontStyle('normal');
                var titleStr = configFile.layout.appTitle + ' - ' + filterVal;
                doc.text(25, 4.5, titleStr);                    

                // Logo
                var logo_msf = "data:image/png;base64,";
                doc.addImage(logo_msf,'PNG',245,185.4,43,19.6);

            // Legend layout

                var legendX = 245;

                // General title for legend section
                doc.setFontSize(14).setFontStyle('bold').setTextColor(209,33,33);											
                doc.text(legendX, 15, "Legend");

                function PDFaddSvgBloc(domObject, docY){
                    var svg = $('#' + domObject).html();                   
                    if (svg) {
                        svg = svg.replace(/\r?\n|\r/g, '').trim();												  
                    }
                    var canvas = document.createElement('canvas');
                    var context = canvas.getContext('2d');
                    context.clearRect(0, 0, canvas.width, canvas.height);
                    canvg(canvas, svg);
                    var dataUrl_lB = canvas.toDataURL('image/png');
                    doc.addImage(dataUrl_lB, 'PNG', legendX, docY);                       
                }                    

                // Subtitle for geometry
                doc.setFontSize(10).setFontStyle('bold').setTextColor(0,0,0);									
                doc.text(legendX, 25, configFile.data.analysisLayer.geometry.name);

                // Y start ref
                var yStartRef = 31;

                // Legend 1 (rates)
                if (config.rate && config.cumulRate) {                  
                    doc.setFontSize(9).setFontStyle('italic').setTextColor(0,0,0);
                    var forLegendDesc = $("#selectorAnalysis").val() === configFile.analysisFunctions.types.rates.analysis_1.config.abbreviation ? configFile.analysisFunctions.types.rates.analysis_1.config.printName : configFile.analysisFunctions.types.rates.analysis_2.config.printName;
                    doc.text(245, 30, forLegendDesc);
                    PDFaddSvgBloc("legendRates", yStartRef);

                    yStartRef += pxToMm(parseFloat($('#legendRates').css('height').split("p")[0])) + 5;
                }
                // Legend 2 (cases)
                doc.setFontSize(9).setFontStyle('italic').setTextColor(0,0,0);
                doc.text(245, yStartRef, configFile.analysisFunctions.types.cases.titleForLegend);                    
                yStartRef += 1;
                PDFaddSvgBloc("legendCases", yStartRef);

                yStartRef += pxToMm(parseFloat($('#legendCases').css('height').split("p")[0])) + 5;

                // Legend 3 (others)
                doc.setFontSize(10).setFontStyle('bold').setTextColor(0,0,0);
                doc.text(245, yStartRef, configFile.analysisFunctions.legendParam.otherSectionTitle);  
                yStartRef += 1;
                PDFaddSvgBloc("legendOthers", yStartRef);



                
                function PDFaddTextBloc(arrayOfTextLines, docX, docY, spacing) {
                    $.each(arrayOfTextLines, function(i, v){
                        doc.text(docX, docY, v);
                        docY += spacing;
                    });
                }

                doc.setFontSize(14).setFontStyle('bold').setTextColor(209,33,33);											
                doc.text(245, 131, "Sources");
                
                doc.setFontSize(9).setFontStyle('normal').setTextColor(0,0,0);
                PDFaddTextBloc([
                    "Cases & rates : MSF",
                    "Admin boundaries : OCHA"
                ], 245, 140, 5); 

//                doc.setFontSize(9).setFontStyle('normal').setTextColor(0,0,0);											
//                doc.text(245, 140, "Rates :");
//
//                doc.setFontSize(9).setFontStyle('italic').setTextColor(0,0,0);										
//                doc.text(245, 145, "- MSF data");

                doc.setFontSize(7).setFontStyle('normal').setTextColor(0,0,0);                
                PDFaddTextBloc([
                    "Date of export : " + todayDDMMYYYY + ".",
                    "This map has been exported from MSF ",
                    "Map Centre on personal initiative. ",
                    "MSF GIS Unit is not responsible for the ",
                    "content and display."
                ], 245, 168, 3);               

                doc.setFontSize(6).setTextColor(0,0,0).setFontStyle('normal');
                doc.text(3, 208, "This map is for information purposes only and has no political significance. The boundaries and names shown and the designations used on this map do not imply official endorsement or acceptance by MSF.");

                var forTitleDesc = $("#selectorAnalysis").val() === "WIR" ? "WeeklyIncidenceRate" : "AttackRate";													
                doc.save(configFile.layout.appTitle.replace(/ /g,'') + "_" + filterVal.replace(/ /g,'') + "_" + forTitleDesc + "_export" + todayYYYYMMDD + '.pdf');

                function exitPrint(){
                    $('#map').css('height', initHeight);
                    $('#map').css('width', initWidth);
                    map.updateSize();
                    $('#modalTable').modal('hide');
                }
                
                setTimeout(function(){
                    exitPrint();
                }, 1000);                
            }, 900);            
        });		

        setTimeout(function(){
            map.updateSize();
        }, 600);

    });
}


